### Summary of Core Topics and Concepts

The exam focuses on several key topics in AI, particularly search methods for problem-solving. Here is a summary of the core topics, concepts, principles, and equations that are essential to study for the exam:

#### 1. State Space and State Space Graphs
- **Concepts**: Understanding how to represent a problem as a state space, where each state represents a configuration of the problem.
- **Principles**: Constructing state space graphs by identifying all reachable states from a start state and the transitions between them.
- **Example**: The rabbits crossing puzzle, where states are represented as configurations of rabbits and the empty spot.

#### 2. Search Algorithms
- **Depth First Search (DFS)**:
  - **Concepts**: Exploring as far as possible along each branch before backtracking.
  - **Principles**: Uses a stack (LIFO) to keep track of nodes to visit.
  - **Example**: Listing the first few nodes inspected by DFS in a given graph.

- **Breadth First Search (BFS)**:
  - **Concepts**: Exploring all neighbors at the present depth before moving on to nodes at the next depth level.
  - **Principles**: Uses a queue (FIFO) to keep track of nodes to visit.
  - **Example**: Listing the first few nodes inspected by BFS in a given graph.

- **Best First Search**:
  - **Concepts**: Exploring nodes based on an evaluation function, often using a priority queue.
  - **Principles**: Nodes are expanded based on their heuristic value.
  - **Example**: Listing the first few nodes inspected by Best First Search in a given graph.

- **Hill Climbing**:
  - **Concepts**: Iteratively moving to the best neighboring state.
  - **Principles**: Uses a heuristic to determine the best next state.
  - **Example**: Listing the first few nodes inspected by Hill Climbing in a given graph.

#### 3. Genetic Algorithms
- **Concepts**: Using evolutionary principles to solve optimization problems.
- **Principles**: Selection, crossover, and mutation to generate new solutions.
- **Example**: Generating offspring using Partially Mapped Crossover (PMX).

#### 4. Traveling Salesman Problem (TSP)
- **Concepts**: Finding the shortest possible route that visits each city exactly once and returns to the origin city.
- **Principles**: Using heuristics like Nearest Neighbor and Greedy algorithms to find approximate solutions.
- **Example**: Constructing a tour using the Nearest Neighbor Heuristic or Greedy Heuristic.

#### 5. Heuristics and Evaluation Functions
- **Concepts**: Using heuristics to guide search algorithms.
- **Principles**: Manhattan distance, savings in TSP, etc.
- **Example**: Using Manhattan distance in search algorithms.

### Equations
For the mathematical aspects, particularly in the context of TSP and heuristics, the following equations and concepts are important:

1. **Manhattan Distance**:
   \[
   d(p, q) = |p_x - q_x| + |p_y - q_y|
   \]
   where \( p \) and \( q \) are points in a grid.

2. **Savings in TSP**:
   \[
   s_{ij} = c_{i0} + c_{0j} - c_{ij}
   \]
   where \( c_{i0} \) is the cost from city \( i \) to the base city \( 0 \), and \( c_{ij} \) is the cost from city \( i \) to city \( j \).

3. **Cost of a Tour**:
   \[
   \text{Cost} = \sum_{i=1}^{n} c_{i,i+1}
   \]
   where \( c_{i,i+1} \) is the cost of traveling from city \( i \) to city \( i+1 \).

